        val queue =
            ArrayDeque(
                listOf(
                    PinpadStub.Companion.CombinedResult(PinpadResult(PinpadResult.OPN, ResultCode.PP_OK)),
                    PinpadStub.Companion.CombinedResult(PinpadResult(PinpadResult.TLI, ResultCode.PP_OK)),
